import React from 'react';
import { useNavigate } from 'react-router-dom';

function Project() {
  const navigate = useNavigate()
  return (
    <div>
      <button onClick={() => navigate('ecommerce')}>Ecommerce Website</button>
      <button onClick={() => navigate('twice')}>Twice Fans Page</button>
      <button onClick={() => navigate('info.php')}>Bookkeeping Website</button>
    </div>
  );
}

export default Project;
